import React from 'react';

const VehicleDetails = () => {
  return (
    <div className="service-details-container">
      <h1>Vehicles for Transportation</h1>
      <p>Here you can provide full details about the vehicles available for transportation, including types of vehicles, pricing, and availability.</p>
    </div>
  );
};

export default VehicleDetails;
